import React from "react";
import { View, Text,Button } from "react-native";
import { useState } from "react";

import styl from "./styles"
import customFonts from "../../styles/font"


const Contact = ({ navigation: {navigate} }) => {

    return (

        <View>
            <View style={styl.searchContainer}>
                <Text style={customFonts.h1}>Contact</Text>
                <Button title="Add contact" onPress={() => navigate("Addcontact")} />
                {/* Search komes hera!! */}
            </View>
            <View>
                {/* Hear is the main view {list views} */}
                <Text style={customFonts.displayName}>Siggi valur</Text>
            </View>
        </View>
        
    );
}

export default Contact;
